import React from "react";
import "materialize-css/dist/css/materialize.min.css";
import Modal from "./modal";
import { connect } from "react-redux";

function mapStateToProps (state) {
  const { booksList } = state;
  console.log("book in booklist component: " + JSON.stringify(state));
  return { booksList };
}

function BookList ({ booksList })  {
 
 
    return (
        <div>
          <Modal />

          <ul className="books-list">
              {booksList && booksList.length ? booksList.map((booksList, index) => {
              return <li key={`booksList-${booksList.id}`}>{booksList.name}</li>;
              })
              : "No books, yay!"}
         </ul>
        </div>

        

    );
  }

export default connect(mapStateToProps)(BookList);
